import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App() {
  const [items, setItem] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3000', {
      headers: {
        'Content-Type': 'application/json',
        Accept: 'application/json'
      }
    })
      .then(res => res.json())
      .then(items => setItem(items));

      const result = axios('http://localhost:3000');

      setItem(result.items)
  });

  return (
    <div className="App">
      <p>bonjour</p>
      {items.map(i => <p>{i.title}</p>)}
    </div>
  );
}

export default App;
